import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  height: 100vh;
  width: 100vw;
`;

function SlideTwo() {

  const textData = [
    {
      start: '.sticky-trigger-1',
      duration: '20vh',
      properties: [
        {
          startValue: 0,
          endValue: -40,
          unit: 'vh',
          property: 'translateY',
        },
      ],
    },
    {
      start: '.sticky-trigger-1',
      startOffset: '90vh',
      duration: '30vh',
      properties: [
        {
          startValue: -40,
          endValue: -100,
          unit: 'vh',
          property: 'translateY',
        },
      ],
    },
  ];

  return (
    <Plx
      className='sticky-slide-2'
      parallaxData={textData}
    >
      <StyledSlideTwo>
          <CarInfoDisplay />
      </StyledSlideTwo>
    </Plx>
  );
}

export default SlideTwo;
